window.bookSummaryJSON = "<p>Fallon Oâ€™Sullivan and his vampire gangsters rule the city. He is the Prince of Paradise, greed, prostitution, money laundering, and death. But he has a weakness: a four-foot-eleven, silver-haired princess, Nova. Fallon discovered Nova in a Truck Stop Diner. He bought her, paid for her, and protected her and her family, but he never told her he loved her.</p> <p>Magic McCullen, a vampire hitman employed by Fallon, also falls in love with Nova. Magic has no trouble letting Nova know that she is the most crucial thing in his very long life. The two gangster vampires battle to win their prize. Will either win Nova's heart?</p>"; 
